scriptlet.script:
var errorMessageList = errorMessage.split('\n');
var filteredErrorMsg = '';

for (i=0; i<errorMessageList.length; i++){
	if(errorMessageList[i].trim() == '' ||  errorMessageList[i].trim() == null){
		continue;
	} else {
		filteredErrorMsg += errorMessageList[i] + '\n';
	}
}

scriptletContext.put("errorMessage",filteredErrorMsg.trim());

